import React, { useState } from 'react'
import axios from 'axios';
import Buttons from '../components/Buttons';
import Input from '../components/Input';
import List from '../components/List';
import '../css/Main.css';

const Main = () => {

    const [lists, setLists] = useState();

    // 작성한 todo list 불러오기
    const getList = async () => {
        await axios.get('/api/lists/get')
            .then((res) => {
                console.log(res)
                setLists(res.data)
            })
            .catch((err) => {
                console.log(err)
            })
    }

    return (
        <div className='main'>
            <h1>To Do List</h1>
            <Input/>
            <List lists={lists} />
            <Buttons/>
        </div>
    )
}

export default Main;
